import React, {useEffect, useState} from "react";
import {useSelector} from "react-redux";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faCheck} from "@fortawesome/free-solid-svg-icons";

const CallLogs = () => {
    const cdrsData = useSelector(state => state.cdrsData);
    const loading = useSelector(state => state.loadingStatus);

    const [loadingStatus, setLoadingStatus] = useState(false);
    useEffect(() => {
        setLoadingStatus(true);
    }, [cdrsData]);
    return (

        <table className="table table-sm table-striped table-bordered table-hover">
            <thead>
            <tr>
                <th>Date/Time</th>
                <th>From</th>
                <th>To</th>
                <th>Duration</th>
            </tr>
            </thead>
            <tbody>{

                    cdrsData === undefined ? null : cdrsData.map((item, i) => {

                    return (
                        <tr key={i}>

                            <td>
                                {loadingStatus ? <FontAwesomeIcon color="green" icon={faCheck}/> : <FontAwesomeIcon color="red" icon={faCheck}/> + item.unix_timestamp}

                            </td>
                            <td>
                                {item.from}
                            </td>
                            <td>
                                {item.to}
                            </td>
                            <td>
                                {item.duration_seconds}
                            </td>
                        </tr>
                    )

                })
            }
            </tbody>
        </table>
    )

};


export default CallLogs;
